# @lc code=start
class Solution:
    def findRadius(self, houses, heaters):
        heaters = sorted(heaters) + [float('inf')]
        i = r = 0
        for x in sorted(houses):
            while x >= sum(heaters[i:i+2]) / 2.:
                i += 1
            r = max(r, abs(heaters[i] - x))
        return r
        '''
        houses.sort()
        heaters.sort()
        print(len(houses))
        minimum_radius = 0
        for i in houses:
            minimum_distance = pow(10, 9)
            flag = False
            if i > max(heaters):
                minimum_radius = max(minimum_radius, max(houses) - max(heaters))
                break
            for j in heaters:
                temp = abs(i - j)
                if temp <= minimum_radius:
                    flag = True
                    for k in heaters:
                        if i > k and i - k > minimum_radius:
                            try:
                                heaters.remove(k)
                            except:
                                pass
                    break
                if minimum_distance > temp:
                    minimum_distance = temp
            if not flag and minimum_radius < minimum_distance:
                minimum_radius = minimum_distance
        return minimum_radius
        '''
